import './css/style.css';

const App = () => {
  return (
    <div className="header">
      <Logotype />
      <Nav />
    </div>
  );
}

const Logotype = () => {
  return (
    <>
      <h1>Учу фронтенд</h1>
      <span>Не много не мало</span>
    </>
  );
}

const Nav = () => {
  return ( 
    <nav>
      <ul>
        <li><a href='#s'>CSS</a></li>
        <li><a href='#s'>JS</a></li>
        <li><a href='#s'>REACT</a></li>
      </ul>
    </nav>
  );
}

export default App;
